import React from 'react';

const Portfolio = () => {
    return (
        <div className="portfolio">
            <div className="container">
                <h1>Portfolio</h1>
                <div className="project">
                    <h2>Title</h2>
                    <p>Description</p>
                </div>
            </div>
        </div>
    );
};

export default Portfolio;
